import { createSlice } from "@reduxjs/toolkit"


const toolkitSlice = createSlice({
    name: 'toolkit',
    initialState: {
        value: 0,
    },
    reducers: {
        increment(state) {
            state = state + 1
        },
        decrement(state) {
            state = state - 1
        }
    }
})

export default toolkitSlice.reducer
export const { increment, decrement } = toolkitSlice.actions
